const Checkout = () => {
    const {cartitems} = useContext(CartContext);
    return(
        <div>
            checkout page
            <div>
                {
                    cartitems.map((item)=>{
                        const {id,name,imageUrl,price,quantity} = item
                        return(
                        <div key={id}></div>
                        )

                    })
                }
            </div>
        </div>
    )
}

export default Checkout;
